import React from 'react'
import { useDispatch, useSelector } from 'react-redux';

function Todos() {
    const dispatch = useDispatch()
    const todos = useSelector(state => state.todos.todos)
    console.log(todos); 
  return (
    <>
    <div>Todos</div>
    {todos.email}
    {todos.location}
    </>
  )
}

export default Todos
